import React from 'react';
import { Link, useNavigate } from 'react-router-dom';

const Navbar = () => {
  const navigate = useNavigate();
  const userId = localStorage.getItem('userId');

  const handleLogout = () => {
    localStorage.removeItem('userId');
    navigate('/login');
  };

  return (
    <nav className="bg-gray-900 text-orange-400 p-4 shadow-md">
      <div className="max-w-7xl mx-auto flex justify-between items-center">
        
        {/* Logo b√™n tr√°i */}
        <div className="flex items-center space-x-2">
          <div className="text-2xl font-bold flex items-center">
            <span className="text-orange-400">ü•ï</span>
            <span className="ml-2 leading-tight">
              <div>eat</div>
              <div>this</div>
              <div>much</div>
            </span>
          </div>
        </div>

        {/* Menu ƒëi·ªÅu h∆∞·ªõng */}
        <div className="flex items-center space-x-8 pt-2">
          <Link to="/supported-diets" className="hover:text-white">Supported Diets</Link>
          <Link to="/pricing" className="hover:text-white">Pricing</Link>
          <Link to="/professionals" className="hover:text-white">For Professionals</Link>
        </div>

        {/* ƒêƒÉng nh·∫≠p / ƒëƒÉng k√Ω b√™n ph·∫£i */}
        <div className="flex flex-col items-end">
          {userId ? (
            <>
              <button onClick={handleLogout} className="bg-red-500 text-white px-4 py-1 rounded hover:bg-red-600">
                ƒêƒÉng xu·∫•t
              </button>
            </>
          ) : (
            <>
              <Link
                to="/register"
                className="bg-orange-500 text-white px-4 py-1 rounded hover:bg-orange-600"
              >
                Sign Up
              </Link>
              <Link to="/login" className="text-sm mt-1 hover:text-white">
                Already a member? Sign in
              </Link>
            </>
          )}
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
